package Array_MatriX;

public class MultiDim_Array {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		char gr1[][] = {{'a','b','f'},{'t','g','y'}};
		
		
		for(int i=0;i<=gr1.length-1;i++)
		{
			for(int j=0;j<=gr1[i].length-1;j++)
			{
				System.out.print(gr1[i][j]+" ");
			}
			System.out.println();
		
		
		
	}
	}
	
}
